import axios from 'axios'
const baseUrl = '/api/blogs'



const getAll = () => {
  const request = axios.get(baseUrl)
  return request.then(response => response.data)
}

const add = newBlog => {
  const request = axios.post(newBlog)
  return request.then(response => response.data)
}


export default { getAll, add }
